import React from 'react';
import { Link } from 'react-router-dom';
const NotFound = () => {
  return (
    <div className="overflow-y-scroll min-h-screen bg-[rgb(18,18,18,0.9)] flex justify-center items-center w-full text-white flex-col">
        <div className='bg-[rgb(30,30,30,0.8)] text-white'>
        <h1>404 - Not Found</h1>
        <p>Sorry, the page you are looking for does not exist.</p>
        <Link to="/" className="text-3xl text-white font-light uppercase tracking-widest cursor-pointer">Return to the homepage</Link>
        </div>
    </div>
  );
};

export default NotFound;
